-- ----------------------------
-- Procedure structure for spInsertMsEmployee
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[spInsertMsEmployee]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[spInsertMsEmployee]
GO

CREATE PROCEDURE [dbo].[spInsertMsEmployee]
	-- Add the parameters for the stored procedure here
	
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

    -- Insert statements for procedure here
	
	DECLARE @temp TABLE(
		RNUM INT IDENTITY(1, 1),
		EMPLID INT,
		EmployeeName VARCHAR(MAX),
		DEPTName VARCHAR(MAX),
		FlagAtt BIT,
		FlagAbsence BIT
	);

	INSERT INTO @temp
	SELECT a.EmployeeKey, a.Name, b.DepartmentName, 0, 1
	FROM [SHIVA\CAPPS].HRD.dbo.HRDEMPLOYEE1 a
	JOIN [SHIVA\CAPPS].HRD.dbo.HRDDepartment b ON a.DepartmentKey = b.DepartmentKey
	WHERE a.ActiveFlag = 1;

	DECLARE @TempCount INT,
			@Count INT,
			@EMPLID INT,
			@EmployeeName VARCHAR(MAX),
			@DEPTName VARCHAR(MAX),
			@FlagAtt BIT,
			@FlagAbsence BIT;

	SELECT @Count = COUNT(*), @TempCount = 1 FROM @temp;

	WHILE(@TempCount <= @Count)
	BEGIN
		SELECT @EMPLID = EMPLID, @EmployeeName = EmployeeName, @DEPTName = DEPTName, @FlagAtt = FlagAtt, @FlagAbsence = FlagAbsence FROM @temp WHERE RNUM = @TempCount;

		INSERT INTO ITDEV_DoorPrize.dbo.Ms_Employee
		VALUES(@EMPLID, @EmployeeName, @DEPTName, @FlagAtt, @FlagAbsence, NULL);

		SET @TempCount = @TempCount + 1;
	END
END
GO


-- ----------------------------
-- Procedure structure for spInsertUpdateMsEmployee
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[spInsertUpdateMsEmployee]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[spInsertUpdateMsEmployee]
GO

CREATE PROCEDURE [dbo].[spInsertUpdateMsEmployee]
	-- Add the parameters for the stored procedure here
	@EMPLID INT,
	@Name VARCHAR(MAX),
	@DeptName VARCHAR(MAX),
	@FlagAtt BIT

AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

    -- Insert statements for procedure here
	
	DECLARE @AbsenceTime DATETIME = NULL;

	IF EXISTS (SELECT EmployeeKey FROM ITDEV_DoorPrize.dbo.Ms_Employee WHERE EmployeeKey = @EMPLID)
	BEGIN
		IF((SELECT AbsenceTime FROM ITDEV_DoorPrize.dbo.Ms_Employee WHERE EmployeeKey = @EMPLID) IS NULL)
		BEGIN
			IF(@FlagAtt = 1)
			BEGIN
				SELECT @AbsenceTime = GETDATE();
			END

			UPDATE ITDEV_DoorPrize.dbo.Ms_Employee SET EmployeeKey = @EMPLID, EmployeeName = @Name, DeptName = @DeptName, 
			FlagAttendance = @FlagAtt, AbsenceTime = @AbsenceTime
			WHERE EmployeeKey = @EMPLID;
		END

		ELSE
		BEGIN
			IF(@FlagAtt = 1)
			BEGIN
				UPDATE ITDEV_DoorPrize.dbo.Ms_Employee SET EmployeeKey = @EMPLID, EmployeeName = @Name, DeptName = @DeptName, 
				FlagAttendance = @FlagAtt
				WHERE EmployeeKey = @EMPLID;
			END
			
			ELSE
			BEGIN
				UPDATE ITDEV_DoorPrize.dbo.Ms_Employee SET EmployeeKey = @EMPLID, EmployeeName = @Name, DeptName = @DeptName, 
				FlagAttendance = @FlagAtt, AbsenceTime = @AbsenceTime
				WHERE EmployeeKey = @EMPLID;
			END
		END
	END

	ELSE
	BEGIN
		INSERT INTO ITDEV_DoorPrize.dbo.Ms_Employee
		VALUES(@EMPLID, @Name, @DeptName, 1, 1, GETDATE());
	END
END
GO


