-- ----------------------------
-- Procedure structure for SpUpdateFlagAbsensi
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[SpUpdateFlagAbsensi]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[dbo].[SpUpdateFlagAbsensi]
GO

CREATE PROCEDURE [dbo].[SpUpdateFlagAbsensi] 
	-- Add the parameters for the stored procedure here
	@EMPLID INT

AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT OFF;
	
	DECLARE @flagattendance int=0;
	
	SELECT @flagattendance=INT1 from Ms_UDC where DESC1='Active'

    -- Insert statements for procedure here
	
	IF((SELECT FlagAttendance FROM ITDEV_DoorPrize.dbo.Ms_Employee WHERE EmployeeKey = @EMPLID) <= @flagattendance)
	BEGIN
	  SET @flagattendance = @flagattendance + 1
		
		UPDATE ITDEV_DoorPrize.dbo.Ms_Employee SET FlagAttendance = @flagattendance, AbsenceTime = GETDATE()
		WHERE EmployeeKey = @EMPLID;
		
		INSERT INTO ITDEV_DoorPrize.dbo.Tr_Absen_history (EmployeeKey,FlagAttendance,LogTime) VALUES (@EMPLID,@flagattendance,GETDATE());
		RETURN 1;
	END
	ELSE
    RETURN 0;

END
GO


